import React from "react";

function Header() {
  return (
    <div>
      <div className="row">
        <div>About</div>
        <div>Awards</div>
        <div>Blog</div>
        <div>Contact</div>
        <div>Education</div>
        <div>Experience</div>
        <div>Projects</div>
        <div>Skills</div>
      </div>
    </div>
  );
}

export default Header;
